যোৱা ০৯/০৪/২০২৫ ইং তাৰিখে অসম ছাত্ৰ পৰিষদ, গুৱাহাটী বিশ্ববিদ্যালয় গোটৰ উদ্যোগত বিশ্ববিদ্যালয়ৰ বিৰিঞ্চি কুমাৰ বৰুৱা প্ৰেক্ষাগৃহৰ বাকৰিত পোনপ্ৰথমবাৰৰ বাবে অনুষ্ঠিত হোৱা "বৰদৈচিলা" শীৰ্ষক ব'হাগী আদৰণি অনুষ্ঠানৰ সফল সমাপ্তিৰে অন্ত পৰিল।
অনুষ্ঠানটোত অতিথি হিচাপে উপস্থিত আছিল গুৱাহাটী বিশ্ববিদ্যালয়ৰ সন্মানীয় উপাচাৰ্য্য শ্ৰদ্ধাৰ ননীগোপাল মহন্ত ডাঙৰীয়া, অনুপ চেতিয়া ডাঙৰীয়া, এ এম টেলিভিচনৰ সঞ্চালিকা ড° অক্ষতা নাৰায়ণ ডাঙৰীয়ানী।
বিশ্ববিদ্যালয়ৰ ছাত্ৰ-ছাত্ৰী সকলৰ বিশাল উপস্থিতিয়ে এই অনুষ্ঠান অতি সুন্দৰ কৰি তুলিছে। অনুষ্ঠানটোৰ প্ৰতি সঁহাৰি জনোৱাৰ বাবে বিশ্ববিদ্যালয়ৰ প্ৰতিজন ছাত্ৰ-ছাত্ৰীৰ ওচৰত আমি চিৰ কৃতজ্ঞ।
