যোৱা ২৪/০৩/২৫ তাৰিখে গুৱাহাটী বিশ্ববিদ্যালয়ৰ প্ৰসন্ন নাৰায়ণ চৌধুৰী ছাত্ৰ জিৰণি কোঠাত অনুষ্ঠিত হৈ যোৱা অসম গণ পৰিষদৰ ভাতৃ সংগঠন অসম ছাত্ৰ পৰিষদ, গুৱাহাটী বিশ্ববিদ্যালয় গোটৰ সাধাৰণ সভাত মোক সাধাৰণ সম্পাদকৰ দৰে গুৰু দায়িত্ব অৰ্পণ কৰা হয়। দলটোৱে মোৰ প্ৰতি এইখিনি বিশ্বাস ৰখাৰ বাবে ম‌ই চিৰকৃতজ্ঞ। এই গধুৰ দায়িত্বভাৰ অৰ্পণ কৰা সকলো জেষ্ঠ বিষয়ববীয়া তথা সদস্যলৈ ধন্যবাদ জ্ঞাপন কৰিছো। ইয়াৰ পূৰ্বে ম‌ই অসম ছাত্ৰ পৰিষদ, কামৰূপ মহানগৰ সমিতিৰ সম্পাদক হিচাপে প্ৰায় এবছৰ আৰু অসম ছাত্ৰ পৰিষদ, নলবাৰী জিলা সমিতিৰ উপ-সভাপতি হিচাপে প্ৰায় দুবছৰ সেৱা আগবঢ়াইছিলো। মোক এই গুৰু দায়িত্ব দিয়াৰ বাবে অসম ছাত্ৰ পৰিষদৰ কেন্দ্ৰীয় সমিতিৰ কাৰ্যকৰী সভাপতি উৎপল হালৈ দা আৰু উপ-সভাপতি নিপজ্যোতি কলিতা দাক বিশেষ ভাৱে ধন্যবাদ জনাইছোঁ।
আগন্তুক দিনত বিশ্ববিদ্যালয়ৰ ছাত্ৰ সমাজৰ হকে দলীয় সকলো নিয়ম অক্ষুন্ন ৰাখি সকলো কাৰ্য সম্পন্ন কৰি যাম।
